import React from 'react'
import TodoItem from './TodoItem'
import style from "./Todo.module.css"


const TodoList = () => {
    return (
        <div className={style.List}>
           <ul>
               <TodoItem />
           </ul>
        </div>
    )
}
export default TodoList;
